    false,nt"url": null,nt"notes": "Dewberry collected LiDAR for ~3,341 square
    miles in various Virginia Counties, a part of Worcester County, and Hooper's Island.
    The acquisition was performed by Terrapoint. This metadata covers the LiDAR produced
    for the King William project area. The nominal pulse spacing for this project is
    1.6 ft (0.5 meters). This project was collected with a sensor which collects intensity
    values for each discrete pulse extracted from the waveform. GPS Week Time, Intensity,
    Flightline and echo number attributes were provided for each LiDAR point. Dewberry
    used proprietary procedures to classify the LAS according to contract specifications:
    1-Unclassified, 2-Ground, 7-Noise, 9-Water, 10-Ignored Ground due to breakline proximity,
    and 11-Withheld (reclassified by OCM to Class 15). Dewberry produced 3D breaklines
    and combined these with the final LiDAR data to produce seamless hydro flattened
    DEMs for the 415 tiles (5000 ft x 5000 ft) that cover the project area.",nt"license_title":
